Okay, the issue is that the Interstellar Fuel Switch Integration patch doesn't delete the LiquidFuel and Oxidizer resources from parts it acts on, so SMURFF treats them like regular fuel tanks, but then the IFS module has stock-balanced values in it, so SMURFF's changes get ignored.  The stock parts turn out OK because Color-Coded Canisters patches them before IFS does, and it properly removes the resource nodes, so SMURFF patches the IFS module.

[@FreeThinker](https://forum.kerbalspaceprogram.com/index.php?/profile/117389-freethinker/), you need to add the following to your IntegrateInterstellarFuelSwitch patch:

    !RESOURCE[LiquidFuel] {}
    !RESOURCE[Oxidizer] {}

(I also need to adjust SMURFF's IFS patch. The 'manifest' of resources has changed somewhat.)

